import React from "react";
import { theName,Comment } from "./App";

const CompB = () => {
    return (
        <>
            <theName.Consumer>
                {(fname, comment) => {
                   return (
                       <>
                           <Comment.Consumer>
                               {(comment)=>{
                                   return(
                                       <>
                                           <h1> my name is {fname} and something is going {comment} </h1>
                                       </>
                                   )
                               }}
                           </Comment.Consumer>
                       </>
                   )
                }}
            </theName.Consumer>
        </>
    );
}

export default CompB;
